import Shell from "./Shell";
import {
  Container,
  CardContent,
  useTheme,
  FormControl,
  Select,
  InputLabel,
  MenuItem,
} from "@mui/material";
import { useState } from "react";

function Financial() {
  const theme = useTheme();
  const [sales, setSales] = useState("$50,000");
  const [payroll, setPayroll] = useState("$50,000");

  const properties = {
    selectionsContainer: {
      component: "div",
    },
    salesSelect: {
      labelId: "annual sales",
      id: "annual sales",
      label: "Annual Sales",
      value: sales,
      onChange: (e) => setSales(e.target.value),
    },
    payrollSelect: {
      labelId: "annual payroll",
      id: "annual payroll",
      label: "Annual Payroll",
      value: payroll,
      onChange: (e) => setPayroll(e.target.value),
    },
    // salesForm: { fullWidth: true },
    // payrollForm: { marginBottom: "1rem" },
  };

  const styles = (theme) => ({
    cardContent: {
      display: "flex",
      flexDirection: "column",
      width: "80%",
      [theme.breakpoints.up("sm")]: {
        justifyContent: "center",
      },
    },

    // -----------------------------------
    selectionsContainer: {
      display: "flex",
      flexDirection: "column",
    },
    annualSales: {
      marginBottom: "1rem",
      color: "#3BCEAC",
      [theme.breakpoints.up("sm")]: {
        marginRight: "1rem",
        flex: 2,
      },
    },
    salesForm: { marginBottom: "1rem" },
    payrollForm: { marginBottom: "1rem" },
    annualPayroll: {
      [theme.breakpoints.up("sm")]: {
        width: "40%",
      },
    },
    // ------------------------------------
    // industryContainer: {
    //   [theme.breakpoints.down("sm")]: {
    //     marginTop: "1rem",
    //   },
    //   [theme.breakpoints.up("sm")]: {
    //     // width: "90%",
    //   },
    // },
  });

  // const industries = [
  //   { type: "physician_office", label: "Physicians Offices", id: "621111" },
  //   { type: "law_firms", label: "Law Firms", id: "541110" },
  //   { type: "dentist_office", label: "Dentist Office", id: "621210" },
  //   { type: "insurance_office", label: "Insurance Office", id: "524298" },
  //   {
  //     type: "commercial_banks",
  //     label: "Commercial Banking",
  //     id: "522110",
  //   },
  //   { type: "landscape_care", label: "Landscape Care", id: "561730" },
  //   { type: "hvac", label: "HVAC", id: "238220" },
  //   {
  //     type: "real_estate_agencies",
  //     label: "Real Estate Agencies",
  //     id: "531210",
  //   },
  //   {
  //     type: "general_automotive_care",
  //     label: "General Automotive Care",
  //     id: "811111",
  //   },
  //   { type: "supermarkets", label: "Supermarkets", id: "445110" },
  // ];

  return (
    <Shell
      heading="Financial Information"
      index={3}
      content={
        <CardContent sx={styles(theme).cardContent}>
          <Container
            {...properties.selectionsContainer}
            sx={styles(theme).selectionsContainer}
          >
            <FormControl fullWidth sx={styles(theme).salesForm}>
              <InputLabel>Annual Sales</InputLabel>
              <Select {...properties.salesSelect}>
                <MenuItem value={"$50,000"}>$50,000</MenuItem>
                <MenuItem value={"$75,000"}>$75,000</MenuItem>
                <MenuItem value={"$100,000"}>$100,000</MenuItem>
                <MenuItem value={"$150,000"}>$150,000</MenuItem>
                <MenuItem value={"$200,000"}>$200,000</MenuItem>
              </Select>
            </FormControl>
            <FormControl fullWidth sx={styles(theme).payrollForm}>
              <InputLabel>Annual Payroll</InputLabel>
              <Select {...properties.payrollSelect}>
                <MenuItem value={"$50,000"}>$50,000</MenuItem>
                <MenuItem value={"$75,000"}>$75,000</MenuItem>
                <MenuItem value={"$100,000"}>$100,000</MenuItem>
                <MenuItem value={"$150,000"}>$150,000</MenuItem>
                <MenuItem value={"$200,000"}>$200,000</MenuItem>
              </Select>
            </FormControl>
          </Container>

          {/* <Container sx={styles(theme).industryContainer}></Container> */}
        </CardContent>
      }
    />
  );
}

export default Financial;
